<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
</head>

<body>
    <!-- Unordered List -->
    <ul style="list-style-type: square;">
        <li>HTML</li>
        <li>CSS</li>
        <li>JS</li>
    </ul>

    <!-- Ordered List -->
    <ol type="I">
        <li>HTML</li>
        <li>CSS</li>
        <li>JS</li>
    </ol>

    <!-- Description List -->
    <dl>
        <dt>HTML</dt>
        <dd></dd>
        <dt>CSS</dt>
        <dd></dd>
    </dl>

    <!-- Nested List -->
    <ul style="list-style-type: square;">
        <li>food
            <ol type="I">
                <li>chips</li>
                <li>chocolate</li>
                <li>pharsan</li>
            </ol>
        </li>
        <li>food
            <ol type="I">
                <li>chips</li>
                <li>chocolate</li>
                <li>pharsan</li>
            </ol>
        </li>
    </ul>

    <!-- image  -->
    <img src="/image/Facebook.png" alt="Facebook">

    <!-- iframe -->
    <iframe src="https://www.jiocinema.com/" height="300px" width="400px" frameborder="0"></iframe>
    <iframe src="https://www.youtube.com/embed/PYW091-jqfY" height="300px" width="400px"
        title="YouTube video player" frameborder="0"
        allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share"
        allowfullscreen></iframe>
</body>

</html>
